import React from "react";
import { createMuiTheme,MuiThemeProvider,responsiveFontSizes,ThemeProvider,Typography} from '@material-ui/core';
import './postData.css'

//Some styling for responsive font sizes
let theme = createMuiTheme();
theme = responsiveFontSizes(theme);




export default function PostData({ postData, setPostData, setPostId }) {
  const backTofeed = () => {
    setPostId(0);
    setPostData([]);
  };

  return (
    <div className="container">
        <MuiThemeProvider theme={theme}>
            <Typography variant="h2" gutterBottom>{postData.title}</Typography>
            <Typography variant="h2" gutterBottom>{postData.title}</Typography>
            <img src="./image.jpeg" />
        </MuiThemeProvider>


    </div>
  );
}
